$.aqf=H.a(["I was born and raised in rural Maine where I lived for 18 years.","At 3, I taught myself how to read. Thus began my bibliophilia.","At 10, I smacked my first tennis ball. I was horrible.","At 11, I left the country for the first time to visit family in Canada. I've been a wanderlust ever since.","At 12, I was diagnosed with a back disorder, Kyphosis, and had to wear a brace throughout middle school and half of high school.","In 8th grade I timidly gave a speech on world hunger and won my school's speech competition. Thanks to this experience, I actually enjoy public speaking.","When I was 15, I made my first website using HTML and CSS. It was atrocious to say the least.","At 16, I shocked my Harvard-educated orthopedist by improving my spine's curve by 5 degrees from lifting weights and wearing my brace: something he'd never seen before. This experience taught me the beauty and power of weightlifting.","From 15-17, I played 1st singles for my varsity high school tennis team. This was my first experience with real competition. I was hooked.",'When I was 17, I created my first Java program to print "Hello world". It was the ultimate gateway drug.',"Junior year of high school I was seeded the 11th best female tennis player in Maine. I guess I got slightly better than when I first started.","After graduating in 2020, I took a gap year and worked full-time among brilliant engineers. I flew a plane, acted as a project manager, and learned how the real world actually works.","After living in Maine for 18 years, my wanderlust got the best of me and I began college at UNC Charlotte in 2021."],t.s)
